let history = [], now = 0;
onUiLoaded(() => {
    function jumpUrl(url) {
        iframe.contentWindow.location.href = url;
    }
    function clearHistory() {
        history = [];
        now = 0;
    }
    function bindOnclick() {
        $('#pix_tabs .tab-nav button')[0].onclick =  () => {
            jumpUrl('https://pix.ink/model?navbar=hidden');
            bindOnclick();
            clearHistory();
        }
        $('#pix_tabs .tab-nav button')[1].onclick = () => {
            jumpUrl('https://pix.ink/article?tab=词条分享&navbar=hidden');
            bindOnclick();
            clearHistory();
        }
        $('#pix_tabs .tab-nav button')[2].onclick = () => {
            jumpUrl('https://pix.ink/artwork/rank?navbar=hidden');
            bindOnclick();
            clearHistory();
        }
        $('#pix_tabs .tab-nav button')[3].onclick = () => {
            jumpUrl('https://pix.ink/article?tab=技术讨论&navbar=hidden');
            bindOnclick();
            clearHistory();
        }
        $('#pix_tabs .tab-nav button')[4].onclick = () => {
            jumpUrl('https://pix.ink/article?tab=平凡的日常&navbar=hidden');
            bindOnclick();
            clearHistory();
        }
        $('#pix_tabs .tab-nav button')[5].onclick = () => {
            jumpUrl('https://civitai.com/');
            bindOnclick();
            clearHistory();
        }
    }
    gradioApp().getElementById('download_predict').style.display = 'none';
    let iframeUrl = '';
    const iframe = gradioApp().getElementById('pixink-iframe');
    bindOnclick();
    window.back = function() {
        if(history.length > 1) {
            now--;
            jumpUrl(history[history.length + now - 1]);
        }
    }
    window.forward = function() {
        if(history.length > 1 && now < 0) {
            now++;
            jumpUrl(history[history.length + now - 1]);
        }
    }
    window.addEventListener('message', (event) => {
        if(event.data.type === 'url') {
            iframeUrl = event.data.data;
            if(history.length === 0) history.push(iframeUrl);
            if(iframeUrl.includes('navbar=hidden')) return;
            if(iframeUrl.toLocaleLowerCase.includes('blocked')) return;
            if(iframeUrl.includes('?')) iframeUrl += '&navbar=hidden';
            else iframeUrl += '?navbar=hidden';
            gradioApp().getElementById('url-box').value = iframeUrl;
            iframe.contentWindow.location.href = iframeUrl;
            if(now < 0) {
                history = history.slice(0, history.length + now);
            }
            now = 0;
            history.push(iframeUrl);
        }
        if(event.data.type === 'download') {
            const data = event.data;
            const inputEvent = new Event('input', { bubbles: true, cancelable: true });
            if(data.modelType === 'lora') {
                $('#download_predict textarea')[0].value = data.url;
                $('#download_predict textarea')[0].dispatchEvent(inputEvent);
                $('#download_predict .primary')[0].click();
            }
            else {
                $('#download_predict textarea')[2].value = data.url;
                $('#download_predict textarea')[0].dispatchEvent(inputEvent);
                $('#download_predict .primary')[1].click();
            }
            Swal.fire('成功啦','已发送下载任务，请在WebUI控制台查看下载进度','success');
        }
    });
    window.share = function() {
        if (navigator.share) {
            navigator.share({
              title: '片绘社区',
              text: '快来看看我发现了什么好东西！',
              url: iframeUrl,
            }).then(() => console.log('share done')).catch((error) => Swal.fire('失败啦','分享时发生未知错误','error'));
          } else {
            Swal.fire('失败啦','您的浏览器太旧了','error');
        }
    }
    window.home = function() {
        iframe.contentWindow.location.href = 'https://pix.ink';
        gradioApp().getElementById('url-box').value = 'https://pix.ink';
    }
});

